import React from 'react';
import '../styles/Header.css';  // pentru Header.js

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <img src="/path_to_logo/logo.png" alt="JavaVerse" />
      </div>
      <nav className="nav">
        <button className="nav-btn">Login</button>
        <button className="nav-btn">Sign Up</button>
      </nav>
    </header>
  );
}

export default Header;
